import React from 'react'
import "./App.css"

function LeftBar({headclick,clicked})
{
  console.log("headClick"+headclick)
  
  if(headclick)
  {
    return (
      <div className="l-navbar show" id="nav-bar" style={{"height" : "91vh"}}>
      <nav className ="navs">
        <div>
  
  
          <div className ="nav_list">
  
          
  
            <a href="/#" className ="nav_link w-100">
              <i className ='fa-solid fa-play nav_icon'></i>
              <span className ="nav_name ">Ongoing</span>
            </a>
  
            <a  href="/#" className ="nav_link w-100 text-center ">
              <i className ='fa-solid fa-circle-xmark nav_icon'></i>
              <span className ="nav_name ">Ongoing</span>
            </a>
  
            <a  href="/#" className ="nav_link w-100">
              <i className ='fa-solid fa-hourglass-half nav_icon'></i>
              <span className ="nav_name">End</span>
            </a>
  
            <a  href="/#" className ="nav_link w-100">
              <i className ='fa-solid fa-bag-shopping nav_icon'></i>
              <span className ="nav_name">Sold</span>
            </a>
  
  
  
            <div id="" className={clicked ? 'createbtn' : 'none'}>
              <a  className =" nav_logo w-100" href="/#">
                <i className ='fa-solid fa-circle-plus  nav_logo-icon'></i>
                <span className ="nav_logo-name">Create Now</span>
              </a>
            </div>
  
          </div>
  
        </div>
  
        <a href="/#" className ="nav_link">
          <i className ='bx bx-log-out nav_icon'></i>
          <span className ="nav_name">SignOut</span>
        </a>
  
      </nav>
    </div>
    )
  }
  else
  {
    return (
      <div className ="l-navbar" id="nav-bar" style={{"height" : "91vh"}}>
      <nav className ="navs">
        <div>
  
  
          <div className ="nav_list">
  
          
  
            <a href="/#" className ="nav_link w-100">
              <i className ='fa-solid fa-play nav_icon'></i>
              <span className ="nav_name ">Ongoing</span>
            </a>
  
            <a  href="/#" className ="nav_link w-100 text-center ">
              <i className ='fa-solid fa-circle-xmark nav_icon'></i>
              <span className ="nav_name ">Ongoing</span>
            </a>
  
            <a  href="/#" className ="nav_link w-100">
              <i className ='fa-solid fa-hourglass-half nav_icon'></i>
              <span className ="nav_name">End</span>
            </a>
  
            <a  href="/#" className ="nav_link w-100">
              <i className ='fa-solid fa-bag-shopping nav_icon'></i>
              <span className ="nav_name">Sold</span>
            </a>
  
  
  
            {/* <div id="createbtn" className ="createbtn">
              <a  className =" nav_logo w-100" href="/#">
                <i className ='fa-solid fa-circle-plus  nav_logo-icon'></i>
                <span className ="nav_logo-name">Create Now</span>
              </a>
            </div> */}
  
          </div>
  
        </div>
  
        <a href="/#" className ="nav_link">
          <i className ='bx bx-log-out nav_icon'></i>
          <span className ="nav_name">SignOut</span>
        </a>
  
      </nav>
    </div>
    )
  }
  
  // if(clicked)
  // {
     
  //   return (
  //     <div className="l-navbar" id="nav-bar" style={{"height" : "91vh"}}>
  //     <nav className ="navs">
  //       <div>
  
  
  //         <div className ="nav_list">
  
          
  
  //           <a href="/#" className ="nav_link w-100">
  //             <i className ='fa-solid fa-play nav_icon'></i>
  //             <span className ="nav_name ">Ongoing</span>
  //           </a>
  
  //           <a  href="/#" className ="nav_link w-100 text-center ">
  //             <i className ='fa-solid fa-circle-xmark nav_icon'></i>
  //             <span className ="nav_name ">Ongoing</span>
  //           </a>
  
  //           <a  href="/#" className ="nav_link w-100">
  //             <i className ='fa-solid fa-hourglass-half nav_icon'></i>
  //             <span className ="nav_name">End</span>
  //           </a>
  
  //           <a  href="/#" className ="nav_link w-100">
  //             <i className ='fa-solid fa-bag-shopping nav_icon'></i>
  //             <span className ="nav_name">Sold</span>
  //           </a>
  
  
  
  //           {/* <div id="createbtn" className ="createbtn">
  //             <a  className =" nav_logo w-100" href="/#">
  //               <i className ='fa-solid fa-circle-plus  nav_logo-icon'></i>
  //               <span className ="nav_logo-name">Create Now</span>
  //             </a>
  //           </div> */}
  
  //         </div>
  
  //       </div>
  
  //       <a href="/#" className ="nav_link">
  //         <i className ='bx bx-log-out nav_icon'></i>
  //         <span className ="nav_name">SignOut</span>
  //       </a>
  
  //     </nav>
  //   </div>
  //   )
  // }
  return (
    <div className ="l-navbar" id="nav-bar" style={{"height" : "91vh"}}>
    <nav className ="navs">
      <div>


        <div className ="nav_list">

        

          <a href="/#" className ="nav_link w-100">
            <i className ='fa-solid fa-play nav_icon'></i>
            <span className ="nav_name ">Ongoing</span>
          </a>

          <a  href="/#" className ="nav_link w-100 text-center ">
            <i className ='fa-solid fa-circle-xmark nav_icon'></i>
            <span className ="nav_name ">Ongoing</span>
          </a>

          <a  href="/#" className ="nav_link w-100">
            <i className ='fa-solid fa-hourglass-half nav_icon'></i>
            <span className ="nav_name">End</span>
          </a>

          <a  href="/#" className ="nav_link w-100">
            <i className ='fa-solid fa-bag-shopping nav_icon'></i>
            <span className ="nav_name">Sold</span>
          </a>



          <div id="createbtn" className ="createbtn">
            <a  className =" nav_logo w-100" href="/#">
              <i className ='fa-solid fa-circle-plus  nav_logo-icon'></i>
              <span className ="nav_logo-name">Create Now</span>
            </a>
          </div>

        </div>

      </div>

